import styled from "styled-components";
import {Theme} from "../Thems.styled";

export const ButtonStyled = styled.button`
  display: flex;
  justify-content: center;
  align-items: center;
  min-width: 86px;
  min-height: 30px;
  border-radius: 5px;

  //primary
  background-color: ${Theme.colors.colorBtn};
  
  //outlined
`
